import React from "react";
import Header from "../../components/Header";
import project_1 from "../../assets/Project_8.png"

const Project = () => {
  return (
  	<div>
      <Header/> 
      <header className="py-5">
        <div class="d-flex justify-content-center">
          <i class="fas fa-laptop-code fa-3x"></i><h1 class="ms-3">My Project</h1>
        </div>
        <div className="py-3 container mt-4">
            <div class="card" style={{width : '18em'}}>
              <img class="card-img-top" src={project_1} alt="Card image cap"/>
              <div class="card-body">
                <h5 class="card-title">Metalit</h5>
                <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
              </div>
              <div class="card-body">
                <a href="#" class="card-link">Card link</a>
                <a href="#" class="card-link">Another link</a>
              </div>
            </div>
        </div>
      </header>
	</div>
    );
  };

export default Project;
